import React from 'react';
import './NewExercise.css';

function NewExercise(){
    return (
        <>
            <div className="header-newExercise">
            </div>
            <div className="btn">
                <div>
                    <input type="button" id="signup" onclick="location.href='../exercise.html'" value="Done"/>
                </div>
                <div>
                    <input type="button" id="login" onclick="location.href='../exercise.html'" value="Cancel"/>
                </div>
            </div>
        </>
    );
}

export default NewExercise;
